import './App.css';
import Navbar from './Components/Navbar/Navbar';
import React from 'react';



function App() {
  // Render the main App component
  return (
    <div>
        <Navbar />
        <Routes>
          <Route path="/Sign_Up" element={<SignUp />} />
          <Route path="/Login" element={<Login />} />
          {/* Add other routes as needed */}
        </Routes>
    </div>
  );
}

export default App;
